selector_to_html = {"a[href=\"sections/Our_Clients.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Our Clients<a class=\"headerlink\" href=\"#our-clients\" title=\"Link to this heading\">#</a></h1><p>Creating recordkeeping models that perfectly meet your company\u2019s needs</p><p>Below is a list of our clients. If you need to contact a specific company, use the search form, or browse the list by clicking on one of the letters.</p>", "a[href=\"sections/Terms_of_Service.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Proofread: Terms of Service<a class=\"headerlink\" href=\"#proofread-terms-of-service\" title=\"Link to this heading\">#</a></h1><p><em>Terms of Service: Creation of Secure Recordkeeping Models Tailored to Your Company\u2019s Needs</em></p><p>By accessing and using this website, you consent to adhere to the following terms and conditions, along with any additional terms and conditions published on any page of this site. It is imperative to read all terms and conditions thoroughly. These terms and conditions are subject to change at any time; hence, periodically review them. Moreover, when utilizing specific services, you may be subject to further guidelines or terms applicable to such services, which may be posted occasionally or that you may have to agree to before using such services.</p>", "a[href=\"sections/Professional_Partners.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Professional Partners<a class=\"headerlink\" href=\"#professional-partners\" title=\"Link to this heading\">#</a></h1><h2>Proofread: Professional Partners<a class=\"headerlink\" href=\"#proofread-professional-partners\" title=\"Link to this heading\">#</a></h2><p><em>More than a stock transfer agent</em></p>", "a[href=\"sections/Privacy.html#our-security-practices-and-information-accuracy\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Our Security Practices and Information Accuracy<a class=\"headerlink\" href=\"#our-security-practices-and-information-accuracy\" title=\"Link to this heading\">#</a></h2><p>We actively safeguard customer information by restricting access to the personal and account details of our customers to those employees who require this information to perform their job duties. We adhere to physical, electronic, and procedural safeguards that comply with federal standards to protect customer information.</p><p>Additionally, we maintain internal controls to ensure the accuracy and completeness of customer information.</p>", "a[href=\"sections/Company_News.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Company News<a class=\"headerlink\" href=\"#company-news\" title=\"Link to this heading\">#</a></h1><h2>Proofread: Company News<a class=\"headerlink\" href=\"#proofread-company-news\" title=\"Link to this heading\">#</a></h2><p>(Where is the news?)</p><p>Explore our latest company news, including press releases, market updates, and announcements.</p>", "a[href=\"sections/Professional_Partners.html#proofread-professional-partners\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Proofread: Professional Partners<a class=\"headerlink\" href=\"#proofread-professional-partners\" title=\"Link to this heading\">#</a></h2><p><em>More than a stock transfer agent</em></p>", "a[href=\"sections/Company_News.html#proofread-company-news\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Proofread: Company News<a class=\"headerlink\" href=\"#proofread-company-news\" title=\"Link to this heading\">#</a></h2><p>(Where is the news?)</p><p>Explore our latest company news, including press releases, market updates, and announcements.</p>", "a[href=\"sections/Join_Our_Team.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Join Our Team<a class=\"headerlink\" href=\"#join-our-team\" title=\"Link to this heading\">#</a></h1><p><em>Experienced, dedicated and customer-oriented stock transfer and software development professionals</em></p>", "a[href=\"sections/Privacy.html#proofread-privacy\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Proofread: Privacy<a class=\"headerlink\" href=\"#proofread-privacy\" title=\"Link to this heading\">#</a></h2><p>Your privacy is a priority at Transfer Online\u2122.</p><p>Transfer Online\u2019s Privacy Policy applies to all visitors to this website. At Transfer Online, we are committed to safeguarding customer information. Since your privacy is paramount to us, we will not share nonpublic information about you without your consent.</p>", "a[href=\"sections/Privacy.html#we-gather-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">We Gather Information<a class=\"headerlink\" href=\"#we-gather-information\" title=\"Link to this heading\">#</a></h2><p>As part of delivering financial products or services, we may obtain information about you from the following sources:</p>", "a[href=\"sections/Privacy.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Privacy<a class=\"headerlink\" href=\"#privacy\" title=\"Link to this heading\">#</a></h1><h2>Proofread: Privacy<a class=\"headerlink\" href=\"#proofread-privacy\" title=\"Link to this heading\">#</a></h2><p>Your privacy is a priority at Transfer Online\u2122.</p><p>Transfer Online\u2019s Privacy Policy applies to all visitors to this website. At Transfer Online, we are committed to safeguarding customer information. Since your privacy is paramount to us, we will not share nonpublic information about you without your consent.</p>", "a[href=\"sections/Privacy.html#former-customers\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Former Customers<a class=\"headerlink\" href=\"#former-customers\" title=\"Link to this heading\">#</a></h2><p>Our Privacy Policy continues to apply to you even if you are no longer a customer of Transfer Online.</p>", "a[href=\"sections/About_Us.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">About Us<a class=\"headerlink\" href=\"#about-us\" title=\"Link to this heading\">#</a></h1><p>Transfer Online\u2122 combines professional expertise with creative technologies to offer comprehensive solutions as an online stock transfer agent, financial services provider, and consulting firm. Our expertise spans traditional services and the integration of innovative technologies.</p><p>We forge new models for recordkeeping that cater to the evolving needs of growing companies. Capable of tackling any technology challenge, we deliver flexible solutions customized to your unique requirements.</p>", "a[href=\"#about-us\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">About Us<a class=\"headerlink\" href=\"#about-us\" title=\"Link to this heading\">#</a></h1><p>This section has all proofread content related to the <strong>About Us</strong> section of SOLO 2.0.</p>", "a[href=\"sections/Copyright.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Copyright<a class=\"headerlink\" href=\"#copyright\" title=\"Link to this heading\">#</a></h1><p>Our proprietary software grants you immediate access to your shares and shareholder information.</p><p>All art, text, design, branding, logos, graphics, photos, and other content of this website (\u201cSite Content\u201d) are proprietary to Transfer Online, Inc.\u2122 and/or its partners, who have granted us permission. You may view, download, and print the Site Content subject to the following conditions:</p>", "a[href=\"sections/Privacy.html#sharing-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Sharing Information<a class=\"headerlink\" href=\"#sharing-information\" title=\"Link to this heading\">#</a></h2><p>We may provide information about you to third parties outside the Transfer Online corporate family without your consent, as the law permits, including:</p>", "a[href=\"sections/About_Us.html#our-commitment\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Our Commitment<a class=\"headerlink\" href=\"#our-commitment\" title=\"Link to this heading\">#</a></h2><p>At Transfer Online, we are dedicated to providing excellence in customer service for every transaction, every time. This commitment is driven by our core values: accuracy, speed and friendliness, value, and adherence to regulatory compliance, ensuring a partnership you can trust.</p><p>Our success is measured by the true results we achieve for our clients, reflecting their realities and objectives.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
